#### Property exempt from distress

**2**   (1) The following personal property is not liable to seizure by distress for rent or penalty:

(a) the beds, bedding and bedsteads, including cradles and carriages in ordinary use by the debtor and the debtor's family;

(b) the necessary and ordinary wearing apparel of the debtor and the debtor's family;

(c) one cooking stove with pipe and furnishings, one other heating stove with pipe, one set of cooking utensils, one lamp, one table, one washstand with furnishings, 6 towels, one clock, one broom, 2 pails, one axe, one saw, one shovel, one washtub, one washboard, 3 smoothing irons, one sewing machine and attachments in domestic use;

(d) for the debtor and for each member of the debtor's family, one chair, one plate, one cup and saucer, one knife, one fork, one spoon;

(e) all necessary fuel, meat, fish, flour and vegetables for the ordinary consumption of the debtor and the debtor's family for 30 days;

(f) tools and implements of or personal property ordinarily used in the debtor's trade or occupation, to the value of $200.

(2) The debtor may select from the tools, implements or personal property referred to in subsection (1) (f) the things that are exempted from seizure under that paragraph.
